		/**
		 * <p>A popup that interrupts the current processing and prompts the user for an action or an input in a modal mode. </p><h3>Overview</h3><p> The Dialog control is used to prompt the user for an action or a confirmation. It interrupts the current app processing as it is the only focused UI element and the main screen is dimmed/blocked. The content of the Dialog is fully customizable. </p><h3>Structure</h3><p> A Dialog consists of a title, optional subtitle, content area and a footer for action buttons. The Dialog is usually displayed at the center of the screen. Its size and position can be changed by the user. To enable this, you need to set the properties <code>resizable</code> and <code>draggable</code> accordingly. In that case the dialog title bar can be focused. While the keyboard focus is located on the title bar, the dialog can be moved with the arrow keys and resized with shift+arrow keys.</p><p>There are other specialized types of dialogs: <ul> <li><a target="_self" href="api/sap.m.P13nDialog">Personalization Dialog</a> - used for personalizing sorting, filtering and grouping in tables</li> <li><a target="_self" href="api/sap.m.SelectDialog">Select Dialog</a> - used to select one or more items from a comprehensive list</li> <li><a target="_self" href="api/sap.m.TableSelectDialog">Table Select Dialog</a> - used to make a selection from a comprehensive table containing multiple attributes or values</li> <li><a target="_self" href="api/sap.ui.comp.valuehelpdialog.ValueHelpDialog">Value Help Dialog</a> - used to help the user find and select single and multiple values</li> <li><a target="_self" href="api/sap.m.ViewSettingsDialog">View Settings Dialog</a> - used to sort, filter, or group data within a (master) list or a table</li> <li><a target="_self" href="api/sap.m.BusyDialog">Busy Dialog</a> - used to block the screen and inform the user about an ongoing operation</li> </ul> </p><h3>Usage</h3><h4>When to use:</h4><p> <ul> <li>You want to display a system message.</li> <li>You want to interrupt the users action.</li> <li>You want to show a message with a short and a long description.</li> </ul> </p><h4>When not to use:</h4><p> <ul> <li>You just want to confirm a successful action.</li> </ul> </p><h3>Responsive Behavior</h3><p> <ul> <li>If the <code>stretch</code> property is set to <code>true</code>, the Dialog displays on full screen.</li> <li>If the <code>contentWidth</code> and/or <code>contentHeight</code> properties are set, the Dialog will try to fill those sizes.</li> <li>If there is no specific sizing, the Dialog will try to adjust its size to its content.</li> </ul> When using the <code>sap.m.Dialog</code> in SAP Quartz and Horizon themes, the breakpoints and layout paddings could be determined by the Dialog's width. To enable this concept and add responsive paddings to an element of the Dialog control, you have to add the following classes depending on your use case: <code>sapUiResponsivePadding--header</code>, <code>sapUiResponsivePadding--subHeader</code>, <code>sapUiResponsivePadding--content</code>, <code>sapUiResponsivePadding--footer</code>. </p><h4>Smartphones</h4><p> If the Dialog has one or two actions, they will cover the entire footer. If there are more actions, they will overflow. </p><h4>Tablets</h4><p> The action buttons in the toolbar are <b>right-aligned</b>. Use <b>cozy</b> mode on tablet devices. </p><h4>Desktop</h4><p> The action buttons in the toolbar are <b>right-aligned</b>. Use <b>compact</b> mode on desktop.</p>
		 */
