		/**
		 * <p>A <code>MessagePopover</code> is used to display a summarized list of different types of messages (error, warning, success, and information messages).</p><h3>Overview</h3><p>It provides a handy and systematized way to navigate and explore details for every message. It is adaptive and responsive. It renders as a dialog with a Close button in the header on phones, and as a popover on tablets and higher resolution devices. It also exposes an event <a target="_self" href="api/sap.m.MessagePopover#events/activeTitlePress">sap.m.MessagePopover#event:activeTitlePress</a>, which can be used for navigation from a message to the source of the issue. </p><h3>Notes:</h3><p> <ul> <li> If your application changes its model between two interactions with the <code>MessagePopover</code>, this could lead to outdated messages being shown. To avoid this, you need to call <code>navigateBack</code> when the model is updated.</li> <li> Messages can have descriptions preformatted with HTML markup. In this case, the <code>markupDescription</code> has to be set to <code>true</code>.</li> <li> If the message cannot be fully displayed or includes a long description, the <code>MessagePopover</code> provides navigation to the detailed description.</li> </ul> </p><h3>Structure</h3><p> The <code>MessagePopover</code> stores all messages in an aggregation of type <a target="_self" href="api/sap.m.MessageItem">sap.m.MessageItem</a> named <code>items</code>.</p><p>A set of properties determines how the items are rendered: <ul> <li> counter - An integer that is used to indicate the number of errors for each type. </li> <li> type - The type of message. </li> <li> title/subtitle - The title and subtitle of the message.</li> <li> description - The long text description of the message.</li> <li> activeTitle - Determines whether the title of the item is interactive.</li> </ul> </p><h3>Usage</h3><h4>When to use:</h4><p> <ul> <li>When you want to make sure that all content is visible on any device.</li> <li>When you want a way to centrally manage messages and show them to the user without additional work for the developer. The <code>MessagePopover</code> is triggered from a messaging button in the footer toolbar. If an error has occurred at any validation point, the total number of messages should be incremented, but the user's work shouldn't be interrupted. Navigation between the message item and the source of the error can be created, if needed by the application. This can be done by setting the <code>activeTitle</code> property to <code>true</code> and providing a handler for the <code>activeTitlePress</code> event. In addition, you can achieve the same functionality inside a different container using the <a target="_self" href="api/sap.m.MessageView">sap.m.MessageView</a> control.</li> </ul> </p><h3>Responsive Behavior</h3><p> On mobile phones, the <code>MessagePopover</code> is automatically shown in full screen mode.<br> On desktop and tablet, the message popover opens in a popover.<br> On desktop the opened popover is resizable, if it is placed in a <a target="_self" href="api/sap.m.Toolbar">sap.m.Toolbar</a>, <a target="_self" href="api/sap.m.Bar">sap.m.Bar</a>, or used in <a target="_self" href="api/sap.m.semantic.SemanticPage">sap.m.semantic.SemanticPage</a>.</p>
		 */
