			/**
			 * <p>Sets a new value for property <a target="_self" href="api/sap.m.Table#methods/getFixedLayout">fixedLayout</a>.</p><p>Defines the algorithm to be used to layout the table cells, rows, and columns. This property allows three possible values: <ul> <li><code>true</code></li> <li><code>false</code></li> <li><code>Strict</code></li> </ul></p><p>By default, the table is rendered with a fixed layout algorithm (<code>fixedLayout=true</code>). This means the horizontal layout only depends on the table's width and the width of the columns, not the content of the cells. Cells in subsequent rows do not affect column width. This allows a browser to provide a faster table layout since the browser can begin to display the table once the first row has been analyzed.</p><p>If this property is set to <code>false</code>, <code>sap.m.Table</code> is rendered with an auto layout algorithm. This means, the width of the table and its cells depends on the content of the cells. The column width is set by the widest unbreakable content inside the cells. This can make the rendering slow, since the browser needs to go through all the content in the table before determining the final layout.<br></p><p>If this property is set to <code>Strict</code> and the <code>width</code> property is defined for all columns (and not the expected "auto" value), then the <code>sap.m.Table</code> control renders a placeholder column which occupies the remaining width of the control to ensure the column width setting is strictly applied.<br></p><p>If there is only one remaining column with a width larger than the table, then this column gets the maximum width available in the table. If the column width is smaller than the table, then the column width is retained, and the remaining width of the table is occupied by the placeholder column.<br></p><p>The placeholder column gets rendered only if there are no columns in the pop-in area.<br></p><p><b>Note:</b> Since <code>sap.m.Table</code> does not have its own scrollbars, setting <code>fixedLayout</code> to false can force the table to overflow, which may cause visual problems. It is suggested to use this property when a table has a few columns in wide screens or within the horizontal scroll container (e.g <code>sap.m.Dialog</code>) to handle overflow. In auto layout mode the <code>width</code> property of <code>sap.m.Column</code> is taken into account as a minimum width.</p><p>When called with a value of <code>null</code> or <code>undefined</code>, the default value of the property will be restored.</p><p>Default value is <code>true</code>.</p>
			 * @param {any} oFixedLayout <p>New value for property <code>fixedLayout</code></p>
			 * @returns this <p>Reference to <code>this</code> in order to allow method chaining</p>
			 */
			setFixedLayout(oFixedLayout?: any): this;
